import {useNavigate} from "react-router-dom";

const ExpenseButton = () => {
    const navigate = useNavigate();

    const routeToExpensePage = () => {
        let path = '/expenses';
        navigate(path);
    }

    return (
        <div>
            <button type={"submit"} onClick={routeToExpensePage}>Expenses</button>
        </div>
    )
}

export default ExpenseButton;
